import React from "react"

function Plus(props){
    const [plusStatus, setPlusStatus] = useState(true)
    return(
        <li className="currentDriver"> {props.object.name} 
            <div className="plusSign">  
                {plusStatus ? "+": "-"}
            </div>
        </li>

    )
}

export default Plus;
